let email=data.email;
let phno=data.phno
console.log(data);

class Home extends React.Component {



    render() {
      return (
        <div className="to-do-list-main">
          <table>
          <tr>
            <th>NAME</th>
            <th>EMP</th>
            <th>email</th>
          </tr>  

          {
            last.map((ele)=>{
              return(<tr>
                <td>{ele}</td>
